pragma solidity ^0.8.10;
import "./Token.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
// Añade una estructura para representar el depósito

contract Bank {
    using SafeMath for uint256;
    //assign Token contract to variable
    event DebugDepositTime(uint depositTime);

    Token private token;
    // hash address - uint
    mapping(address => uint) public clientsBalanceBNB;
    mapping(address => uint) public depositTimeStamp;
    mapping(address => bool) public isDeposited;
   mapping(address => bool) public isDepositedWithDoubleInteres;
     // Nuevo mapping para almacenar el interés acumulado por cada dirección
    mapping(address => uint256) public accumulatedInterest;
    constructor(Token _token) public {
        //assign token deployed contract to variable
        token = _token;
    }

    function deposit() payable public {
        clientsBalanceBNB[msg.sender] = clientsBalanceBNB[msg.sender] + msg.value;
        depositTimeStamp[msg.sender] = block.timestamp;
        isDeposited[msg.sender] = true;

    }

function withdraw() public {
      require(isDeposited[msg.sender] == true, 'Error, no previous deposit');
        // interest BMIW
    uint depositTotalTime = block.timestamp - depositTimeStamp[msg.sender];
    uint interestPerSecond = (100*clientsBalanceBNB[msg.sender]) / 31668017;
    uint interest = interestPerSecond * depositTotalTime;


    // return the BNB to original wallet
    payable(msg.sender).transfer(clientsBalanceBNB[msg.sender] - 0.008 ether );
    clientsBalanceBNB[msg.sender] = 0;

    // Crear el token y lo envia a la addres del msg.sender
    token.mint(msg.sender, interest);
    // reiniciar reposito
    depositTimeStamp[msg.sender] = 0;
    isDeposited[msg.sender] = false;

}
function getBNBBalance() public view returns (uint) {
    return clientsBalanceBNB[msg.sender];
}

function getInterestGenerated() public view returns (uint) {
    require(isDeposited[msg.sender] ||isDepositedWithDoubleInteres[msg.sender]  , 'Error, no previous deposit');
    uint depositTotalTime = block.timestamp - depositTimeStamp[msg.sender];
    uint interestPerSecond = (100 * clientsBalanceBNB[msg.sender]) / 31668017;
    uint interest = interestPerSecond * depositTotalTime;
    return interest;
}

function getBMIWBalance() public view returns (uint) {
    return token.balanceOf(msg.sender);
}
// Nueva función para retirar con tasa
function withdrawWithFee() public payable {
        require(isDeposited[msg.sender], 'Error, no previous deposit');
        require(msg.value == 0.05 ether, 'Error, withdrawal fee is 0.05 BNB');

        // Calcular interés
        uint depositTotalTime = block.timestamp - depositTimeStamp[msg.sender];
        uint interestPerSecond = (100 * clientsBalanceBNB[msg.sender]) / 31668017;
        uint interest = interestPerSecond * depositTotalTime;

        // Transferir el BNB a la billetera original
        payable(msg.sender).transfer(clientsBalanceBNB[msg.sender] - 0.05 ether);
        clientsBalanceBNB[msg.sender] = 0;

        // Crear el token y enviarlo a la dirección del msg.sender
        token.mint(msg.sender, interest);

        // Reiniciar el depósito
        depositTimeStamp[msg.sender] = 0;
        isDeposited[msg.sender] = false;
    }



// Nueva función para realizar un depósito con el doble de interés
function doubleInterestDeposit() payable public {
        // Verificar que no haya un depósito activo
      //  require(!isDepositedWithDoubleInteres[msg.sender], 'Error, active deposit already exists');

    // Verificar si hay un depósito activo
        if (isDepositedWithDoubleInteres[msg.sender]) {
            // Calcular el interés acumulado hasta la fecha actual
            uint256 depositTotalTime = block.timestamp - depositTimeStamp[msg.sender];
            uint256 interestPerSecond = (200 * clientsBalanceBNB[msg.sender]) / 31668017; // Doble de interés
            uint256 interest = interestPerSecond * depositTotalTime;

            // Actualizar el interés acumulado
            accumulatedInterest[msg.sender] = accumulatedInterest[msg.sender] + interest;
        }
        // Reiniciar el timestamp al momento del nuevo depósito
        depositTimeStamp[msg.sender] = block.timestamp;


        // Realizar el depósito
        clientsBalanceBNB[msg.sender] = clientsBalanceBNB[msg.sender] + (msg.value);

        isDepositedWithDoubleInteres[msg.sender] = true;
    }

 // Nueva función para retirar el depósito con bloqueo de 10 minutos
function withdrawWithLock() public payable{
        require(isDepositedWithDoubleInteres[msg.sender], 'Error, no previous deposit with double interes');
        require(block.timestamp >= depositTimeStamp[msg.sender] + 600, 'Error, withdrawal locked');

        // Calcular interés
        uint depositTotalTime = block.timestamp - depositTimeStamp[msg.sender];
        uint interestPerSecond = (200 * clientsBalanceBNB[msg.sender]) / 31668017; // Doble de interés
        uint interest = interestPerSecond * depositTotalTime;

        // Actualizar el interés acumulado
        accumulatedInterest[msg.sender] = accumulatedInterest[msg.sender] + interest;

        // Transferir el BNB a la billetera original
        payable(msg.sender).transfer(clientsBalanceBNB[msg.sender]);
        clientsBalanceBNB[msg.sender] = 0;

        // Crear el token y enviarlo a la dirección del msg.sender
        token.mint(msg.sender, accumulatedInterest[msg.sender]);

        // Reiniciar el depósito
        depositTimeStamp[msg.sender] = 0;
        isDepositedWithDoubleInteres[msg.sender] = false;
         accumulatedInterest[msg.sender] = 0;
    }
}
